import React from 'react';
import { Text, StyleSheet, View } from 'react-native';

export default function NavigationBar() {
    return (
        <View style={styles.container}>
            <Text>asdsa</Text>
        </View>
    )
};

const styles = StyleSheet.create({
    container: {
        marginBottom: 100
      },
});
